import { styled, Box } from "@mui/material";
import { Colors } from "../theme";

export const DashboardContain = styled(Box)(()=> ({
    width:"calc(100% - 265px)",
    height:"calc(100vh - 104px)",
    marginLeft:"auto",
    textAlign:"center",
    background:Colors.primary,
    color:Colors.white,
    padding:"20px"
}))
